import "./App.css";
import theme from "./theme";
import { ThemeProvider } from "@material-ui/core/styles";
import { Typography } from "@material-ui/core";
import CoreToolTip from "./core/components/core-tool-tip";

function App() {
  return (
    <ThemeProvider theme={theme}>
      <Typography variant="h1">Hello World</Typography>
      <CoreToolTip content={
        <Typography variant="body1">Tooltip with HTML</Typography>} />
    </ThemeProvider>
  );
}

export default App;
